import './App.css';
import micon from './assets/micon.png';
import picon from './assets/picon.png';
import p1 from './assets/p1.png';
import p2 from './assets/p2.png';
import p3 from './assets/p3.png';

function App() {
  return (
    <div className="App">
      <div className="head">
      <img src={micon} className='icon'/>
      <img src={picon} className='icon'/>
      </div>
      <h1 className='mheadt'>RING RUNNERZ</h1>
      <div className='three'>
      <img src={p1} className='p1'/>
      <img src={p3} className='p2'/>
      <img src={p2} className='p3'/>
      </div>
      <div className='line'></div>
      <h1 className='minfo'>WHAT IS RING RUNNERZ?</h1>
      <p className='infop'>Ring Runnerzi a play-to-earn game within the ecosystem of MNFST Lab, an avant-garde in the NFT industry.</p>
    </div>
  );
}

export default App;
